import React from 'react';
import '../../../App.css';
import styles from './staff.module.css';

const Staff = () => {
    return (
        <div>
            <section id={styles.sec1}>
                <div className="container">
                    <section className={styles.sec1_content}>
                        <div className={styles.card}>
                            <div className={styles.img1}>
                                <img src="./photos/img1.png" alt=""></img>
                            </div>
                            <div className={styles.info}>
                                <p className={styles.name}>Исаев Ильязбек Э.</p>
                                <p className={styles.position}>декан</p>
                                <p className={styles.email}>iliazcom1@mail.ru</p>
                                <p className={styles.number}>+996555837938</p>
                            </div>
                        </div>
                    </section>
                </div>
            </section>
        </div>
    );
}

export default Staff;
